import { makeStyles } from "@material-ui/core/styles";
import { Typography, Box } from "@material-ui/core";
import Navbar from "./Navbar";

const Resume = () => {
    return (
        <>
            <Navbar />
            <Box component="header">
                <Typography variant="" />
                Resume
            </Box>
        </>

    )
}

export default Resume
